import classes from './Products.module.css';

const products = [
  {title : 'Bhagavad Gita' , price : 295 , description : 'Way of living a good and moral life' },
  {title : 'Wings of Fire' , price : 165 , description : 'Biography of Abdul Kalam'},
  {title : 'Secret off Self Management' ,price : 99 , description : 'Self management techniques and its advantages. '},

]

const Products = (props) => {
  return (
    <section className={classes.products}>
      <h2>Buy your favorite products</h2>
      <ul>
        <ProductItem
          title='Test'
          price={6}
          description='This is a first product - amazing!'
        />
      </ul>
    </section>
  );
};

export default Products;
